INSERT INTO `discussion_board_posts` (`discussionID`, `discussionTitle`, `discussionText`, `postDate`, `userID`) VALUES
(1, 'Where the Sidewalk Ends by Shel Silverstein', 'There is a place where the sidewalk ends\r\nAnd before the street begins,\r\nAnd there the grass grows soft and white,\r\nAnd there the sun burns crimson bright,\r\nAnd there the moon-bird rests from his flight\r\nTo cool in the peppermint wind.\r\n\r\nLet us leave this place where the smoke blows black\r\nAnd the dark street winds and bends.\r\nPast the pits where the asphalt flowers grow\r\nWe shall walk with a walk that is measured and slow,\r\nAnd watch where the chalk-white arrows go\r\nTo the place where the sidewalk ends.\r\n\r\nYes we\'ll walk with a walk that is measured and slow,\r\nAnd we\'ll go where the chalk-white arrows go,\r\nFor the children, they mark, and the children, they know\r\nThe place where the sidewalk ends.', '2017-03-19 00:00:00', 100),
(2, 'i carry your heart with me by E. E. Cummings', 'i carry your heart with me (i carry it in\r\nmy heart) i am never without it (anywhere\r\ni go you go, my dear; and whatever is done\r\nby only me is your doing, my darling)\r\n                                  i fear\r\nno fate (for you are my fate, my sweet) i want\r\nno world (for beautiful you are my world, my true)\r\nand it\'s you are whatever a moon has always meant\r\nand whatever a sun will always sing is you\r\n\r\nhere is the deepest secret nobody knows\r\n(here is the root of the root and the bud of the bud\r\nand the sky of the sky of a tree called life; which grows\r\nhigher than the soul can hope or mind can hide)\r\nand this is the wonder that\'s keeping the stars apart\r\n\r\ni carry your heart (i carry it in my heart)', '2017-03-19 22:11:57', 105),
(3, 'The Road Not Taken', 'Two roads diverged in a yellow wood,\r\nAnd sorry I could not travel both\r\nAnd be one traveler, long I stood\r\nAnd looked down one as far as I could\r\nTo where it bent in the undergrowth;\r\nThen took the other, as just as fair,\r\nAnd having perhaps the better claim,\r\nBecause it was grassy and wanted wear;\r\nThough as for that the passing there\r\nHad worn them really about the same,\r\nAnd both that morning equally lay\r\nIn leaves no step had trodden black.\r\nOh, I kept the first for another day!\r\nYet knowing how way leads on to way,\r\nI doubted if I should ever come back.\r\nI shall be telling this with a sigh\r\nSomewhere ages and ages hence:\r\nTwo roads diverged in a wood, and I-\r\nI took the one less traveled by,\r\nAnd that has made all the difference.', '2017-03-19 22:12:45', 110);
